import "./App.css";
import client from "./ApolloClient";
import { ApolloProvider, useQuery, gql } from "@apollo/client";

const App = () => {
  return (
    <ApolloProvider client={client}>
      <div className="App">React App</div>
    </ApolloProvider>
  );
};

export default App;
